const Todo=({text})=>{
return(
<div className="todo">
<li className="toto-item">{}</li>
<button className="complete-btn">
    <i className="fas fa-check"></i></button>
<button className="trash-btn">
    <i className="fas fa-trash"></i></button>
</div>
);
};
export default Todo;
